import React from 'react';

const Bio=()=>{

    return (
        <React.Fragment>
            <div className="main-bio">
                <h5>Hi there! I'm</h5>
                <h1>Parteek Kumar</h1>
                <h2>I'm a Software Engineer</h2>
                <h3>I'm currently Studying at IIT Delhi, INDIA</h3>
                <h3>I have experience in developing Websites and Apps.</h3>
            </div>
        </React.Fragment>

    );

};


export default Bio;
